import { LoadingButton } from '@mui/lab';
import {useState} from "react";
import {Link} from 'react'
const path =' https://png.pngtree.com/background/20210711/original/pngtree-bread-minimalist-literary-white-food-poster-background-picture-image_1121500.jpg'
function Home(){
    const [buttonState, setbuttonState] = useState(false);
    const handleClick = ()=>{
        setbuttonState(true);
    }

    return(
        <>
            <div id="carouselExampleSlidesOnly" className="carousel slide" data-ride="carousel" >
                <div className="carousel-inner" >
                    <div className="carousel-item active">
                        <img src={path} className="d-block w-100" alt="..."/>
                    </div>
                    <div className="carousel-caption d-none d-md-block" style={{color: 'Purple' , top : '100px'}}>
                        <h1>FoodMan</h1>
                        <h3>Something hot. Something tasty.</h3>
                        <LoadingButton loading={buttonState} loadingIndicator={'Loading..'} variant="outlined" onclick={handleClick}>
                            <Link to={'/items'}>Order Now</Link>
                        </LoadingButton>
                    </div>

                </div>
            </div>

        </>
    );
}

export default Home;
